description:
Yuri, who lost her dog Natsukichi three years ago, is studying to become a veterinarian. One day, she rescued a stray dog from the side of the road and brought it home. While taking care of the dog she&rsquo;s reminded of nostalgic memories of Natsukichi. When she woke up, she saw a handsome guy sleeping next to her. Her deceased pet dog came back in the form of a human?! And wants to have XXX with her!?

